import { Link } from "react-router-dom";
import "./Preferential.css";

const Preferential = () => {
  return (
    <div className="Pref">
      <Link className="bt bt-green" to="/select">
        <h1> NORMAL </h1>
      </Link>

      <Link className="bt2 bt-blue" to="/select">
        <h1> PREFERENCIAL </h1>
      </Link>
    </div>
  );
};

export default Preferential;
